import React from "react";
import { Route } from 'react-router-dom';
import Footer from "../Footer/Footer";
import Header from "../Header/Header";
import Main from "../Main/Main";


function App() {
  return (
    <div className="page">
      <Header />
      <Route path="/">
        <Main />
      </Route>
      <Footer />
    </div>
  );
}

export default App;
